import React from 'react';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import {Form,Col, Button} from 'react-bootstrap';
import {Container, Typography} from "@material-ui/core";
import logo from '../../assets/image/logo.png';
import VCNavigation from '../../components/VCNavigation';
 
const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    marginLeft:200,
    marginBottom:100
  },
  details: {
    display: 'flex',
    flexDirection: 'column',
  },
  content: {
    flex: '1 0 auto',
  },
  cover: {
    width: 400,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
  playIcon: {
    height: 38,
    width: 38,
  },
}));

export default function VaccineRegistration() {
  const classes = useStyles();
  const theme = useTheme();

  return (
    <Container>
      <VCNavigation />
      <div className="VCLabel"  >
        <img src={logo} style={{height:100,width:100, marginLeft:130}} />
 <Typography style={{fontFamily:"Carter One",color:"#fff",fontSize:50,marginLeft:80}} >
        Vaccine
      </Typography>
      <Typography style={{fontFamily:"Carter One",color:"#fff",fontSize:50,marginLeft:20}}>
        Registration
      </Typography>
      </div>
    <Card className={classes.root}>
    <CardMedia
        className={classes.cover}
        // image="https://images.pexels.com/photos/5412/water-blue-ocean.jpg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
        // title="Live from space album cover"
        style={{backgroundColor:"#41649c"}}
      />
      
      <div className={classes.details}>
        <CardContent className={classes.content}>
          <Typography style={{fontSize:30, marginBottom:20,fontFamily: "Carter One", color: "#41649c"}}>
            Registration Form
          </Typography>
        <Form>
  <Form.Row>
    <Form.Group as={Col} controlId="formGridfName">
      <Form.Label className="labelName">Patient-id</Form.Label>
      <Form.Control type="text" placeholder="Enter Patient-id" />
    </Form.Group>
  </Form.Row>
  
  <Form.Group controlId="formGridCenter">
    <Form.Label className="labelName">Verification Center Name</Form.Label>
    <Form.Control placeholder=" Enter Center Name" />
  </Form.Group>

  <Form.Row>
    <Form.Group as={Col} controlId="formGridVCid">
      <Form.Label className="labelName">Approved By</Form.Label>
      <Form.Control type="text" placeholder="Enter ApprovedBy" />
    </Form.Group>
  </Form.Row>
  <Form.Row>
    <Form.Group as={Col} controlId="formGridVCid">
      <Form.Label className="labelName">Verification Result</Form.Label>
      <Form.Control type="text" placeholder="Enter Verify/Not Verify" />
    </Form.Group>
  </Form.Row>

  <Button variant="primary" type="submit">
    Register
  </Button>
</Form>
         
        </CardContent>
        
      </div>
    
    </Card>
    </Container>
  );
}
